Опыт работы - 15 лет, более 500 корпоративных мероприятий, презентаций и городских праздников, более 850 свадеб!

МОИ ГЛАВНЫЕ ОТЛИЧИЯ ОТ ДРУГИХ ВЕДУЩИХ:

1. УНИВЕРСАЛЬНОСТЬ В ПРОВЕДЕНИИ! Провожу праздники с любым количеством присутствующих от 6 до 1 500 чл. Выстраиваю праздник исходя из активности гостей и легко нахожу общий язык с представителями различных поколений!

2. НЕ НАПРЯГАЮ ГОСТЕЙ С ПРОИЗНЕСЕНИЕМ ТОСТОВ И УЧАСТИЕМ В КОНКУРСАХ! У меня в арсенале множество увлекательных игровых блоков, ну а тосты - только по желанию, ведь не все любят и умеют их произносить!

3. КОНКУРСЫ И ИГРОВЫЕ БЛОКИ РАЗРАБАТЫВАЮ САМА! Оригинальные, интригующие, с неожиданной развязкой! Без банальности и пошлости! Особым спросом пользуются мои авторские номера в образах!

4. СОВРЕМЕННОЕ И ОРИГИНАЛЬНОЕ ОБЫГРЫВАНИЕ СВАДЕБНЫХ ТРАДИЦИЙ! Хотите? Отлично! Предложу Вам варианты, как это сделать интересно и не банально!

5. ЛОЯЛЬНАЯ ЦЕНОВАЯ ПОЛИТИКА, ИСХОДЯ ИЗ ВАШЕГО БЮДЖЕТА! У меня гибкая система скидок, Вы можете назначить адекватную цену на мои услуги сами)

6. АВТОРСКИЕ, ТЕМАТИЧЕСКИЕ И КЛАССИЧЕСКИЕ программы в ЕВРОПЕЙСКОМ СТИЛЕ!

ДА. ЧУТЬ НЕ ЗАБЫЛА! У меня есть одна очень редкая особенность не свойственная многим ведущим - моё режиссёрское образование:-)

2004 г. Роль второго плана в фильме «Экстренное торможение»;
2007 г. Инициатор, организатор и ведущая ежегодного праздника Дня студентов (Татья-нин день) в клубе «Акватория»;
2010 г. Ведущая презентации делового журнала The Chief;
2011 г. Ведущая на ежегодном празднике Дня города Санкт-Петербурга;
2013-2014 г. Ведущая церемонии открытия филиалов Бинбанка в Санкт-Петербурге;

Среди клиентов такие крупные компании и учреждения, как ОАО «Газпром», АПХ «Ми-раторг», ГУП «Петербургский метрополитен», ГУП «Водоканал Санкт-Петербурга», ЗАО «Племенной завод ПРИНЕВСКОЕ», СПб ИВЦ (Санкт - Петербургский Информационно - вычислительный центр).
